import { useState } from "react";
import { FaCogs, FaSignOutAlt } from "react-icons/fa";
import { Link } from "react-router-dom";
import "./NavBarAdmin.css";

const NavBarAdmin = () => {
    const [settingsClicked, setSettingsClicked] = useState(false);

    const handleSettingsClicked = () => {
        setSettingsClicked(!settingsClicked);
    }

    return (
        <div className="NavBarAdmin">
            <div className="SettingsBox">
                <button onClick={handleSettingsClicked}><FaCogs/></button>

                <div className="SettingsPopUp">
                    <div className="SettingsPopUpItem">
                        <div className="SettingsPopUpImage">
                            <FaSignOutAlt/>
                        </div>
                        <div className="SettingsPopUpLink">
                            <Link to="/inicio"><a href=""><span>Sair</span></a></Link>
                        </div>
                    </div>
                </div>

            </div>
        </div>
    )
}

export default NavBarAdmin;
